import { Link } from "react-router-dom";

const MovieCatalog = () => {
  return (
    <div className="container">
      <div>
        <h1>Tela de listagem de filmes</h1>
        <div>
          <Link to='/movies/1'>
                Acessar /movies/1
          </Link>
          <Link to='/movies/2'>
                Acessar /movies/2
          </Link>
        </div>
      </div>
    </div>
  );
};

export default MovieCatalog;
